import { Menu } from "lucide-react";

export default function Navbar() {
  return (
    <nav className="bg-white shadow-md px-6 py-3 flex items-center justify-between border-b">
      {/* Brand */}
      <div className="flex items-center gap-3">
        <Menu className="w-6 h-6 text-gray-700 cursor-pointer md:hidden" />
        <span className="font-extrabold text-xl text-blue-600 tracking-wide">
          Doctor APS
        </span>
      </div>

      {/* Navigation */}
      <div className="flex gap-6">
        <button className="text-gray-700 font-medium hover:text-blue-600 transition">
          Dashboard
        </button>
        <button className="text-gray-700 font-medium hover:text-blue-600 transition">
          Profile
        </button>
        <button className="text-red-500 font-medium hover:text-red-700 transition">
          Logout
        </button>
      </div>
    </nav>
  );
}
